import React from "react";
import "./App.css";
import Landing from "./pages/landing/Landing";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/">
          <Landing />
        </Route>

        <Route path="/movies">
          <Landing />
        </Route>

        <Route path="/series">
          <Landing />
        </Route>
        {/*<Landing />*/}
      </Switch>
    </div>
  );
}

export default App;
